import React, {useState, useEffect} from 'react'

export default function App() {

  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data);
        console.log(data);
      }
    );
  }, []);
  return (
    <div>
      Current time is {data}
    </div>
  )
}
